import { Link } from "react-router-dom";
import "./Navbar.css"




function Navbar() {
    return (
        <div className="nav">           
         <h1>Sanaullah</h1>

            <div className="color"> 
           <Link className="link" to="/">Home</Link>
          <Link className="link" to="/about">About</Link>
          <Link className="link" to="/contact">Contact</Link> 
          </div>

        </div>
    )
}

export default Navbar;
